//#region Functions

//#region Func 1

const element = document.getElementById('popup');

const popup = new Overlay({
    element: element,
    positioning: 'bottom-center',
    stopEvent: false,
});
map.addOverlay(popup);
let popover;
function disposePopover() {
    if (popover) {
        popover.dispose();
        popover = undefined;
    }
}
// display popup on click
map.on('click', function (evt) {
    const feature = map.forEachFeatureAtPixel(evt.pixel, function (feature) {
        return feature;
    });
    disposePopover();
    if (!feature) {
        return;
    }
    popup.setPosition(evt.coordinate);



    //    var _coords= feature.getGeometry().getCoordinates()
    //    console.log(_coords)
    //     default_coords = _coords
    popover = new bootstrap.Popover(element, {
        placement: 'top',
        html: true,
        content: feature.get('name'),
    });
    popover.show();
});


map.on('pointermove', showInfo);

const info = document.getElementById('info');
function showInfo(event) {
    const features = map.getFeaturesAtPixel(event.pixel);
    if (features.length == 0) {
        info.innerText = '';
        info.style.opacity = 0;
        return;
    }
    const properties = features[0].getProperties();
    var PropertiesModel = {
        VesselName: properties.VesselName,
        MMSI: properties.MMSI,
        ShipType: properties.ShipType,
        IMO: properties.IMO,
        Longitude: properties.Longitude,
        Latitude: properties.Latitude
    };
    info.innerText = JSON.stringify(PropertiesModel, null, 2);
    info.style.opacity = 1;
}

// change mouse cursor when over marker

map.on('pointermove', function (e) {
    var pixel = map.getEventPixel(e.originalEvent);
    var hit = map.hasFeatureAtPixel(pixel);
    map.getViewport().style.cursor = hit ? 'pointer' : '';
});
// Close the popup when the map is moved
map.on('movestart', disposePopover);


const locate = document.createElement('div');
locate.className = 'ol-control ol-unselectable locate';
locate.innerHTML = '<button title="Locate me">◎</button>';
locate.addEventListener('click', function () {
    if (!vectorsource.isEmpty()) {
        map.getView().fit(vectorsource.getExtent(), {
            maxZoom: 15,
            duration: 500,
        });
    }
});
map.addControl(
    new Control({
        element: locate,
    })
);
